}

var typed = new Typed('.element', {
    strings: ["Inspire.", "Create.", "Connect.",],
    loop: true,
    typeSpeed: 60,
    backSpeed: 60,
    backDelay: 1000,
});


function Banner() {


    return (

        <div className={classes.box}>

            <div id={classes.heading} className={'p-0 p-sm-5'}>
                Your chat where you can .... <span class="typed"/>

            </div>
        </div>
    )
}

export default Banner;
